import { PDFDocument, rgb } from 'pdf-lib'
import fontkit from '@pdf-lib/fontkit'
import JsBarcode from 'jsbarcode'
import toArray from 'stream-to-array'

import { createCanvas } from 'canvas'
const canvas = createCanvas()

const PDF_DEFAULTS = {
    font: '',
    front: '',
    inside: ''
}

const addPng = async ( pdfDoc, page, content, scale, x, y, width, height ) => {
    //const png = fs.readFileSync( FILEPATH + filename)
    if ( !content ) return
    const buff = Buffer.from( content, 'base64')
    const pngImage = await pdfDoc.embedPng(buff)

    const pngDims = pngImage.scale(scale)

    page.drawImage( pngImage, {
        x: x,
        y: y,
        width: width || pngDims.width,
        height: height || pngDims.height
    })
}

const addBarcode = async ( pdfDoc, page, id, height, width, x, y ) => {
    return new Promise( (resolve, reject) => {
        if ( !id ) return resolve()
        JsBarcode( canvas, id, { height: height, width: width, displayValue: true, lineColor: "#444444", fontSize: 10 } )
        const stream = canvas.createPNGStream()
        toArray( stream, async(err, arr) => {
            if ( err ) {
                reject(err)
                return 
            }

            let buffers = []
            for( let i = 0; i < arr.length; ++i ) {
                let part = arr[i]
                buffers.push( (part instanceof Buffer) ? part: Buffer.from(part) )
            }
            let buff = Buffer.concat(buffers)
            const barcodeImage = await pdfDoc.embedPng( buff )
            const barcodeDims = barcodeImage.scale(1.5)
            page.drawImage(barcodeImage, {
                x: x-barcodeDims.width/2,
                y: y,
                width: barcodeDims.width,
                height: barcodeDims.height
            })
            resolve()
        })
    })
}

const drawText = ( page, content, font, x, y, size, color ) => {
    if ( !content ) return
    const defaultSize = 32
    const defaultColor = rgb( 0, 0, 0 )
    if ( !size ) size = defaultSize
    if ( !color ) color = defaultColor 
    page.drawText( content, {
        x: x,
        y: y,
        size: size,
        font: font,
        color: color
    })
}
 
const drawDate = ( page, date, font, x, y, color ) => {
    if ( !date ) return
    let digits = date.split('')
    drawText( page, digits[8], font, x, y, null, color )
    drawText( page, digits[9], font, x+40, y, null, color )
    drawText( page, digits[5], font, x+84, y, null, color )
    drawText( page, digits[6], font, x+124, y, null, color )
    drawText( page, digits[0], font, x+168, y, null, color )
    drawText( page, digits[1], font, x+208, y, null, color )
    drawText( page, digits[2], font, x+248, y, null, color )
    drawText( page, digits[3], font, x+288, y, null, color )
}


export const createDDCC = (details) => {
    return new Promise( async(resolve, reject) => {
        const pdfDoc = await PDFDocument.create()


        //const font = await pdfDoc.embedFont(StandardFonts.Helvetica)
        pdfDoc.registerFontkit(fontkit)
        //const fontBytes = fs.readFileSync( FILEPATH + "Roboto-Regular.ttf" )
        const fontBytes = Buffer.from( PDF_DEFAULTS.font, 'base64')
        const font = await pdfDoc.embedFont( fontBytes )

        const page1 = pdfDoc.addPage( [1260, 891] )
        const page2 = pdfDoc.addPage( [1260, 891] )

        await addPng( pdfDoc, page1, PDF_DEFAULTS.front, 1.0, 0, 0 )
        await addPng( pdfDoc, page2, PDF_DEFAULTS.inside, 1.0, 0, 0 )

        drawText( page1, details.hcid, font, 692, 130 )
        //drawText( page1, details.site, font, 692, 224 )

        drawText( page2, details.name, font, 52, 745 )
        drawText( page2, details.id, font, 680, 745 )
        if ( details.sex === 'male' ) {
            drawText( page2, '', font, 911, 690 ) // Male
        } else if ( details.sex === 'female' ) {
            drawText( page2, '', font, 1083, 690 ) // Female
        }
        drawDate( page2, details.birthDate, font, 52, 648 )

        if ( details.dose1 ) {
            if ( details.dose1.qr ) {
               await addPng( pdfDoc, page1, details.dose1.qr, 0.5, 185, 340, 234, 234 )
            }

            drawDate( page2, details.dose1.date, font, 52, 485 )
            drawText( page2, details.dose1.vaccine, font, 375, 485 )
            if ( details.dose1.brand ) drawText( page2, details.dose1.brand, font, 270, 435 )
            drawText( page2, details.dose1.lot, font, 270, 380 )
            if ( details.dose1.manufacturer ) drawText( page2, details.dose1.manufacturer, font, 270, 320 )
            if ( details.dose1.site ) drawText( page2, details.dose1.site, font, 270, 260 )
            if ( details.dose1.hw ) drawText( page2, details.dose1.hw, font, 270, 206 )
            drawText( page2, details.dose1.country, font, 270, 150 )
            if ( details.dose1.doses ) drawText( page2, details.dose1.doses, font, 52, 51 )  
            if ( details.dose1.date_due ) drawDate( page2, details.dose1.date_due, font, 270, 51 )
        }

        if ( details.dose2 ) {
            if ( details.dose2.qr ) {
                await addPng( pdfDoc, page1, details.dose2.qr, 0.5, 185, 60, 234, 234 )
            }

            drawDate( page2, details.dose2.date, font, 680, 485 )
            drawText( page2, details.dose2.vaccine, font, 1003, 485 )
            if ( details.dose2.brand ) drawText( page2, details.dose2.brand, font, 900, 435 )
            drawText( page2, details.dose2.lot, font, 900, 380 )
            if ( details.dose2.manufacturer ) drawText( page2, details.dose2.manufacturer, font, 900, 320 )
            if ( details.dose2.site ) drawText( page2, details.dose2.site, font, 900, 260 )
            if ( details.dose2.hw ) drawText( page2, details.dose2.hw, font, 900, 206 )
            drawText( page2, details.dose2.country, font, 900, 150 )
            if ( details.dose2.doses ) drawText( page2, details.dose2.doses, font, 680, 51 )  

        }

        addBarcode( pdfDoc, page1, details.hcid, 32, 2, 947, 308 ).then( async() => {
            const pdfBytes = await pdfDoc.save()
            resolve( pdfBytes )  
        }).catch(err => {
            reject(err)
        })

    })
}

export const createQRPDF = (qr) => {
    return new Promise( async(resolve, reject) => {
        const pdfDoc = await PDFDocument.create()

        //const png = fs.readFileSync( FILEPATH + filename)
        const buff = Buffer.from( qr, 'base64')
        const pngImage = await pdfDoc.embedPng(buff)

        const pngDims = pngImage.scale(1.0)
            
        const page = pdfDoc.addPage( [ pngDims.width, pngDims.height ] )

        page.drawImage( pngImage, {
            x: 0,
            y: 0,
            width: pngDims.width,
            height: pngDims.height
        })

        const pdfBytes = await pdfDoc.save()
        resolve( pdfBytes )  

    })
}
